import React from 'react';
import Link from 'next/Link';

class Projects extends React.Component {

    render() {
        return (
            <div>
                <p>This is the Projects page.</p>
                <Link href="/">
                    <a>Home Page</a>
                </Link>
            </div>
        )
    }
}

export default Projects;
